// Navbar.js
import React from 'react';

export default function Navbar({
  landingCount,
  alienCount,
  onStart,
  onDeleteLocal,
  onDeleteRemote,
  log,
  showLog,
  toggleLog,
}) {
  return (
    <div style={{ backgroundColor: '#000', color: '#fff', padding: '10px' }}>
      <span>🛸 נחיתות: {landingCount} | 👽 חייזרים: {alienCount}</span>
      <button onClick={onStart}>צור נחיתה</button>
      <button onClick={onDeleteLocal}>🧹 מחק מקומית</button>
      <button onClick={onDeleteRemote}>⚡ מחק מרחוק</button>
      <button onClick={toggleLog}>{showLog ? 'סגור לוג' : 'לוג 📜'}</button>

      {showLog && (
        <div style={{
          position: 'absolute',
          top: 50,
          right: 10,
          width: '300px',
          height: '300px',
          overflowY: 'scroll',
          background: '#f0f0f0',
          color: '#222',
          fontFamily: 'monospace',
          fontSize: '13px',
          padding: '10px',
          border: '1px solid #000',
          zIndex: 9999
        }}>
          {log.map((line, i) => <div key={i}>{line}</div>)}
        </div>
      )}
    </div>
  );
}
